INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 0.0, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 126501, 2, 0.0, "2023/06/30 12:00:00", 1, 1, -470.0, "ライラエル", 2002, 10003, "2023/09/22 14:59:59");
