INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 0.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 127702, 2, 0.0, "2023/09/15 15:00:00", 2, 1, -470.0, "リンド", 2002, 10005, "2023/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 0.0, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 127702, 2, 0.0, "2023/09/15 15:00:00", 2, 2, -470.0, "リンド", 2002, 10006, "2023/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 0.0, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 127802, 1, 0.0, "2023/09/15 15:00:00", 2, 1, -470.0, "ヴルム", 2002, 10007, "2023/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 6.5, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 127802, 2, 0.0, "2023/09/15 15:00:00", 2, 2, -470.0, "ヴルム", 2002, 10008, "2023/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 0.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 129602, 2, 0.0, "2023/12/15 15:00:00", 3, 1, -470.0, "アネモネ", 2002, 10009, "2024/03/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 0.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 129602, 2, 0.0, "2023/12/15 15:00:00", 3, 2, -470.0, "アネモネ", 2002, 10010, "2024/03/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 0.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 129701, 1, 0.0, "2023/12/15 15:00:00", 3, 1, -470.0, "ネフィ=ネラ", 2002, 10011, "2024/03/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 6.2, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 129701, 2, 0.0, "2023/12/15 15:00:00", 3, 2, -470.0, "ネフィ=ネラ", 2002, 10012, "2024/03/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (5, 3.1, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 130301, 3, 0.0, "2024/03/15 15:00:00", 4, 1, -470.0, "カノン", 2002, 10013, "2024/06/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 6.15, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 130301, 3, 0.0, "2024/03/15 15:00:00", 4, 2, -470.0, "カノン", 2002, 10014, "2024/06/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 130401, 2, 0.0, "2024/03/15 15:00:00", 4, 1, -470.0, "ナーナ", 2002, 10015, "2024/06/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 3.35, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 130401, 2, 0.0, "2024/03/15 15:00:00", 4, 2, -470.0, "ナーナ", 2002, 10016, "2024/06/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 0.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 130502, 1, 0.0, "2024/06/15 15:00:00", 5, 1, -470.0, "ホウオウ", 2002, 10017, "2024/09/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 3.18, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 130502, 2, 0.0, "2024/06/15 15:00:00", 5, 2, -470.0, "ホウオウ", 2002, 10018, "2024/09/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (4, 0.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 130503, 4, 0.0, "2024/06/15 15:00:00", 5, 3, -470.0, "ホウオウ", 2002, 10019, "2024/09/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 4.9, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 123301, 1, 0.0, "2024/06/15 15:00:00", 5, 1, -470.0, "ネア", 2002, 10020, "2024/09/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 4.8, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 123301, 1, 0.0, "2024/06/15 15:00:00", 5, 2, -470.0, "ネア", 2002, 10021, "2024/09/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 4.922, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 133301, 3, 0.0, "2024/09/15 15:00:00", 6, 1, -470.0, "カリザ", 2002, 10022, "2024/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (5, 9.638, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 133301, 3, 0.0, "2024/09/15 15:00:00", 6, 2, -470.0, "カリザ", 2002, 10023, "2024/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 2.88, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 133401, 1, 0.0, "2024/09/15 15:00:00", 6, 1, -470.0, "ミーア", 2002, 10024, "2024/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 4.818, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 133401, 5, 0.0, "2024/09/15 15:00:00", 6, 2, -470.0, "ミーア", 2002, 10025, "2024/12/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 1.78, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 133002, 2, 0.0, "2024/12/15 15:00:00", 7, 1, -470.0, "グレイス", 2002, 10026, "2025/03/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (7, 6.15, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 133002, 1, 0.0, "2024/12/15 15:00:00", 7, 2, -470.0, "グレイス", 2002, 10027, "2025/03/22 14:59:59");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 4.28, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 133102, 6, 0.0, "2024/12/15 15:00:00", 7, 1, -470.0, "ヴァイオレット", 2002, 10028, "2025/03/22 14:59:59");
